import React from "react";
import "./NftCard.css";

function NftCard(props) {
  return (
    <div className="card">
      <div className="image-container">
        <img src={props.url} alt="" />
      </div>
      <div className="metadata">
        <h4>{props.title}</h4>
        <h4>{props.number}</h4>
      </div>
    </div>

  );
}

export default NftCard;
